INSERT INTO `v1_7477c390e7b6de58ba35dcf44158c2719e9ba639c3e008dbaf0bd7bec67b96ab` VALUES (1, 2, "vo_minigame_1013_icon_1_002_001", "vo_minigame_1013_icon_2_002_001", 2, 1000, "訓練はまだ\nここからですわ", 2, 3000, "調子が上がって\nきたなっ");
INSERT INTO `v1_7477c390e7b6de58ba35dcf44158c2719e9ba639c3e008dbaf0bd7bec67b96ab` VALUES (2, 2, "vo_minigame_1013_icon_1_003_001", "vo_minigame_1013_icon_2_003_001", 2, 5000, "クスクス、悪くない\n流れですわね", 2, 3000, "ほらほら、\nまだいけるだろ？");
INSERT INTO `v1_7477c390e7b6de58ba35dcf44158c2719e9ba639c3e008dbaf0bd7bec67b96ab` VALUES (3, 3, "vo_minigame_1013_icon_1_004_001", "vo_minigame_1013_icon_2_004_001", 2, 10000, "すばらしい\n記録ですわ", 2, 3000, "へへっ、おまえら\nやるじゃねえか！");
INSERT INTO `v1_7477c390e7b6de58ba35dcf44158c2719e9ba639c3e008dbaf0bd7bec67b96ab` VALUES (4, 3, "vo_minigame_1013_icon_1_005_001", "vo_minigame_1013_icon_2_005_001", 2, 10000, "乗りに乗って\nいますわね", 3, 3000, "あたしたちはまだ\n止まらねえぜ！");
INSERT INTO `v1_7477c390e7b6de58ba35dcf44158c2719e9ba639c3e008dbaf0bd7bec67b96ab` VALUES (5, 3, "vo_minigame_1013_icon_1_005_002", "vo_minigame_1013_icon_2_005_002", 2, 10000, "まだまだ行きます\nついてきなさい", 3, 3000, "見てろよ！\nマコト班の快進撃だ！");
