INSERT INTO `v1_7477c390e7b6de58ba35dcf44158c2719e9ba639c3e008dbaf0bd7bec67b96ab` VALUES (7, 3, "vo_minigame_1013_icon_1_006_001", "vo_minigame_1013_icon_2_006_001", 2, 0, "ここからは\n前人未到の領域です！", 4, 3000, "どこまで行けるか\n楽しみだなっ！");
