INSERT INTO `v1_7477c390e7b6de58ba35dcf44158c2719e9ba639c3e008dbaf0bd7bec67b96ab` VALUES (9, 4, "vo_minigame_1013_icon_1_007_002", "vo_minigame_1013_icon_2_007_002", 3, 1, "油断大敵です", 5, 1000, "冷やっとしたぜ…！");
INSERT INTO `v1_7477c390e7b6de58ba35dcf44158c2719e9ba639c3e008dbaf0bd7bec67b96ab` VALUES (10, 4, "vo_minigame_1013_icon_1_007_003", "vo_minigame_1013_icon_2_007_003", 3, 1, "忌々しいっ…", 5, 1000, "弱音を吐くなっ");
